import './App.css';


import HomePageDesign from './pages/HomePageDesign';
import HomePageEngineering from './pages/HomePageEngineering';
import About from './pages/About';
import Resume from './pages/Resume';
import DesignWork from './pages/DesignWork';
import EngineeringWork from './pages/EngineeringWork';

import React, { Component } from 'react';
import {
  HashRouter,
  Route,
} from 'react-router-dom';

import Navbar from './components/Navbar';
import ScrollToTopRoute from './components/ScrollToTopRoute';

class App extends Component {
  render(){
    return (
      <HashRouter>
          <Navbar />

          <Route path="/" component ={HomePageDesign} exact />
          <ScrollToTopRoute path="/about" component ={About} exact />
          <ScrollToTopRoute path="/resume" component ={Resume} exact />

          <ScrollToTopRoute path="/design" component ={HomePageDesign} exact />
          <ScrollToTopRoute path="/design-work" component ={DesignWork} exact />

          <ScrollToTopRoute path="/engineering" component ={HomePageEngineering} exact />
          <ScrollToTopRoute path="/engineering-work" component ={EngineeringWork} exact />
      </HashRouter>
    );
  }
}

export default App;
